import * as React from "react";
//import Button from './Button.js';
import Button from "@mui/material/Button";

function App() {
  return (<ButtonGroup variant="contained" aria-label="outlined primary button group">
  <Button>One</Button>
  <Button>Two</Button>
  <Button>Three</Button>
</ButtonGroup>);
}

export default App;
